def time_to_minutes(time: str) -> int:
    hour, minutes = time.strip().split(':')
    
    if hour == '':
        hour = 0
    
    if minutes == '':
        minutes = 0

    return int(hour)*60 + int(minutes)
    
def minutes_to_time(minutes: int) -> int:
    hours = int(minutes/60)
    mins = minutes - hours*60


    hour_f = ""
    if hours < 10:
        hour_f = f"0{hours}"
    else:
        hour_f = str(hours)


    min_f = ""
    
    if mins == 0:
        min_f = "00"
    elif mins < 10:
        min_f = f"0{mins}"
    else:
        min_f = str(mins)

    return f"{hour_f}:{min_f}"
    
def getSleepStuff():
    
    date_yesterday = (datetime.today() - timedelta(1)).strftime("%Y-%m-%d")
    
    # for demo purposes
    date_yesterday = "2021-01-26"
    
    response = table.get_item(
        Key={
            'date': date_yesterday
        }
    )
    
    raw_sleep_time = response['Item']['sleep_time']
    sleep_time = time_to_minutes(raw_sleep_time)

    sat_list = []
    
    for i in range(0, 600, 30):
      satisfaction = tree(sleep_time, i)
      for j in range(len(satisfaction)):
        if satisfaction[j] > 0:
          sat_list.append((i, j))
          
    sorted_list = sorted(sat_list, key = lambda x: x[1], reverse=True)
    best_time = minutes_to_time(sorted_list[0][0])
    
    calculated_response = {
      'SleepPrediction' : {
        'date' : datetime.today().strftime("%Y-%m-%d"),
        'sleep_quantity' : best_time,
        'sleep_quality' : sorted_list[0][1]
      }
    }

    return calculated_response
    
